	EFFECT_END_DATE    	date NULL,
	RECORD_ORDER       	int DEFAULT   0 NOT NULL,
	CREATED            	datetime NOT NULL,
	CREATED_BY         	varchar(50) NOT NULL,
	LAST_UPD           	datetime NULL,
	LAST_UPD_BY        	varchar(50) NULL 
	)
